package kk.practice.javaStackQueue;/** * @author kangkai on 2018/11/12. */public class TestSeqQueue {    public static void main(String[] args) {        SeqQueue<Integer> seq = new SeqQueue<>(5);        seq.add(1);        System.out.println("队头===="+seq.element());        seq.add(2);        System.out.println("队头===="+seq.element());        seq.add(3);        System.out.println("队头===="+seq.peek());        seq.remove();        System.out.println("队头===="+seq.element());        seq.offer(4);        seq.offer(5);    }}